import { useAppSelector } from "../../store";
import { IProduct } from "../../types";
import "./Adminpanel.css";

export const ProductsTable = ({ product }: { product: IProduct }) => {
  const categories = useAppSelector((state) => state.categories);
  const getCategoryName = (id: any): any => {
    const categoryName = categories.find((c) => {
      return c._id === id;
    });
    if (categoryName === undefined) {
      return null;
    }
    return categoryName.name;
  };

  const editProduct = (id: string) => {
    console.log(id)
  }

  const deleteProduct = (id: string) => {
    console.log(id)
  }

  return (
    <>
      <tr>
        <td>{product._id}</td>
        <td>{product.name}</td>
        <td>{getCategoryName(product.category)}</td>
        <td>{product.price}</td>
        <td>{product.amount}</td>
        <td>{product.image}</td>
        <td>
          <button onClick={()=> editProduct()} className="edit-btn__btn">Edit</button>
          <button className="delete-btn__btn">Delete</button>
        </td>
      </tr>
    </>
  );
};
